import React, { Component } from 'react';
// import logo from './logo.svg';
import './App.css';
import Header from './components/Header'
import Login from './components/Login'

class App extends Component {
  constructor() {
    super()
    this.state = {
      loginInfo: []
    }
  }

  getLogin = () => {
    fetch("https://adventure-time-m4cap.herokuapp.com/api/v1/login?username=cebarks", { method: "POST" }).then(person => { console.log(person.json()) })  }

  render() {
    return (
      <div style={styleBody}>
        < Header />
        <div style={styleLogin}>
          < Login />
        </div>
      </div>
    );
  }
}

const styleLogin = {
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  height: "80%"
}

const styleBody = {
  height: "100vh",
  backgroundImage: "url('https://i.pinimg.com/736x/3c/1e/d3/3c1ed3034e801dcb19e06558501fd457.jpg')",
  backgroundSize: "contain"
}

export default App;
